import React, { useState, useEffect } from "react";
import "./ProjectsList.css";

const ProjectsList = () => {
  const [isGridView, setIsGridView] = useState(false);

  const toggleView = () => setIsGridView(!isGridView);

  useEffect(() => {
    const progressBars = document.querySelectorAll(".progress");
    progressBars.forEach((progress) => {
      const bar = progress.querySelector(".bar");
      const value = progress.querySelector("span");
      const percentage = parseInt(value.textContent, 10);

      let animation = { p: 0 };
      const animateProgress = () => {
        const interval = setInterval(() => {
          animation.p += 1;
          if (animation.p > percentage) {
            clearInterval(interval);
            return;
          }
          bar.style.transform = `rotate(${45 + animation.p * 1.8}deg)`;
          value.textContent = animation.p;
        }, 30);
      };

      animateProgress();
    });
  }, []);

  const projects = [
    {
      id: 1,
      title: "Project 1",
      status: "Pending",
      progress: 6,
      start: "09:00",
      end: "10:00",
      team: [
        "https://randomuser.me/api/portraits/men/3.jpg",
        "https://randomuser.me/api/portraits/women/4.jpg",
        "https://randomuser.me/api/portraits/women/7.jpg",
      ],
    },
    {
      id: 2,
      title: "Project 2",
      status: "Canceled",
      progress: 0,
      start: "14:00",
      end: "15:00",
      team: [
        "https://randomuser.me/api/portraits/men/5.jpg",
        "https://randomuser.me/api/portraits/women/6.jpg",
        "https://randomuser.me/api/portraits/men/12.jpg",
      ],
    },
    {
      id: 3,
      title: "Project 3",
      status: "Completed",
      progress: 100,
      start: "11:00",
      end: "12:00",
      team: [
        "https://randomuser.me/api/portraits/men/7.jpg",
        "https://randomuser.me/api/portraits/women/8.jpg",
        "https://randomuser.me/api/portraits/women/12.jpg",
      ],
    },
  ];

  return (
    <div className="project-wrapper">
      <div className="header">
        <div className="title">Projects List</div>
        <button className="toggle-view-btn" onClick={toggleView}>
          Toggle Grid/List
        </button>
        <button className="add-btn">Add New Project</button>
      </div>
      <div
        className={`project-container ${isGridView ? "grid-view" : "list-view"}`}
      >
        <div className="project-header">
          <div className="status">Status</div>
          <div className="project-name" style={{ paddingLeft: "25px" }}>
            Project
          </div>
          <div style={{ textAlign: "right", paddingRight: "25px" }}>Actions</div>
        </div>
        {projects.map((project) => (
          <div className="project-item" key={project.id}>
            <div className="status">
              <div className="progress">
                <div className="barOverflow">
                  <div className="bar"></div>
                </div>
                <span>{project.progress}</span>%
              </div>
              <div
                className={`project-status ${project.status.toLowerCase()}`}
              >
                {project.status}
              </div>
            </div>
            <div className="project-name">
              <div className="project-title">{project.title}</div>
              <div className="project-subtitle">
                <span>Start {project.start}</span> -{" "}
                <span>End {project.end}</span>
              </div>
              <div className="avatars">
                <span>Team: </span>
                {project.team.map((member, index) => (
                  <div className="avatar-user" key={index}>
                    <img src={member} alt={`Team Member ${index + 1}`} />
                  </div>
                ))}
              </div>
            </div>
            <button className="btn-edit">Edit</button>
            <button className="btn-delete">Delete</button>
          </div>
        ))}
      </div>
    </div>
  );
};

export default ProjectsList;
